import './App.css';
import Card from './components/card';
function App() {
  return (
    <div className="App">
      <Card 
      title="Título 1"
      paragraph="Lorem ipsum dolor sit amet."
      links="https://www.google.com"
      linkText="Mas informacion"
      imgUrl="data:image/png;base64,"
      />
        <Card 
      title="Título 2"
      paragraph="Lorem ipsum dolor sit amet totalis completimentis."
      links="https://www.instagram.com/"
      linkText="Mas informacion"
      imgUrl="data:image/png;base64,"
      />
    </div>
  );
}

export default App;
